docs/guides/models.html.body:
ModelsA model represents the data that the user can interact with. For example, the initial states of a user and goat model can look like this:const initialUser = {
  name: '',
  email: '',
};

const initialGoat = {
  color: '',
  breed: '',
};
Models in storesTo set up your app's models for RRF, it's recommended to use combineForms(), which takes in the initial state (or custom reducers) of all your models:import { createStore, applyMiddleware } from 'redux';
import thunk from 'redux-thunk'
import { combineForms } from 'react-redux-form';

const store = createStore(combineForms({
  user: initialUser,
  goat: initialGoat,
}), applyMiddleware(thunk));

export default store;
This works similar to combineReducers() in redux, and will create a single reducer() that converts each key/value pair in the object given to combineForms() into a modelReducer(), and also set up a single formReducer() under the 'forms' key.Note: Since combineForms() returns a single reducer() function, this can be nested however deep if you are already using combineReducers().Updating ModelsInternally, the modelReducer() uses the model path to know which part of the state should be updated.For example, given this state:const state = {
  user: {  
    firstName: 'John',
    lastName: 'Smith',
    phones: [
      { number: '5551234567', type: 'home' },
      { number: '5559876543', type: 'work' }
    ]
  }
}
A value from this object is retrieved with the path 'user.firstName' and a value inside an array is retrieved with 'user.phones[1]'. You can retrieve deep values as well, e.g. 'user.phones[1].number'.For example, to update the second phone number's type, you can dispatch a change to its model path:import { actions } from 'react-redux-form';

// wherever dispatch() is available
dispatch(actions.change('user.phones[1].type', 'mobile'))
Using existing reducersIf you provide a custom reducer for a model's value inside combineForms(), that reducer will automatically be wrapped (decorated) using modeled(). The modeled() reducer will then be able to respond to model changes in React Redux Form. Here's an example:// ...
import myCustomReducer from './myCustomReducer.js';

const store = createStore(combineForms({
  user: initialUser,
  goat: initialGoat,
  custom: myCustomReducer, // 
You will then be able to pass your custom reducer's own actions and have it respond appropriately, and you will also be able to use RRF's actions to update the same model.

docs/api/modelReducer.html.body:
modelReducer(model, initialState)Creates a modelReducer instance function that responds to these actions:actionTypes.CHANGE

actionTypes.LOAD

actionTypes.RESET

and updates the state accordingly.Argumentsmodel (String): A string representation of this model's path in the store.

initialState (Any): The initial state of the model.

Returns(Function): A reducer which updates the state in reaction to the above actions.NotesThe model provided to modelReducer must be the exact path in the state to the model. For most use-case scenarios, this is sufficient:

const initialUserState = {};

const store = createStore(combineReducers({
  user: modelReducer('user', initialUserState),
}));
However, for deeper models, the full path string must be provided:const initialUserState = {};

const store = createStore(combineReducers({
  deep: combineReducers({
    user: modelReducer('deep.user', initialUserState),
  }),
}));

docs/api/combineForms.html.body:
combineForms(forms, [model], [options])Similar to combineReducers() in redux, the combineForms() helper function takes a forms object where:each key is a string model path

each value is either:
(Any) an initial state, or

(Function) an existing reducer


and turns it into a single reducing function (using combineReducers() internally) where essentially:each key/value pair is a modelReducer()

a 'forms' key on the same object is a single formReducer() that handles all forms for all models.

Argumentsforms (Object): An object whose keys correspond to relative string model paths and whose values correspond to:(Any) an initial state for the model, or

(Function) an existing reducer for the model.


[model = ''] (String): The string representation of the parent model containing the child models in the forms object. Defaults to an empty string.
[options] (Object): An options object to override the default options for combineForms():key (String): The single formReducer key. Defaults to 'forms'.

plugins (Array): An array of plugins to pass into the formReducer(). Defaults to no plugins.


Returns(Function): A reducer which updates both the model state and the form state for each of the models inside forms.NotesThe model provided to combineForms() must be the exact path in the state to the parent model. For most use-case scenarios, this is sufficient:

const initialUserState = {};
const initialGoatState = {};

const store = createStore(combineForms({
  user: initialUserState,
  goat: initialGoatState,
}));
However, for deeper parent models, the full path string must be provided:const initialUserState = {};
const initialGoatState = {};

const store = createStore(combineReducers({
  deep: combineForms({
    user: initialUserState,
    goat: initialGoatState,
  }, 'deep'),
}));

// user model state accessed via 'deep.user'
// form state accessed via 'deep.forms'
// user form state accessed via 'deep.forms.user'
